package forLinkedListLab1;//CS 64 Lab 07 //File: WCSLinkedList.java/*A class for maintaining a linked list. Currently it only contains a constructor forcreating a list and a toString method used to display the entire list.*/public class WCSLinkedList < E extends Comparable<E>> {	Node<E> myHead;//reference to the first Node in the list		public WCSLinkedList () {		myHead = null;	}//0 parameter constructor		public String toString() {		Node<E> mover = myHead;		String tempS = "";		while(mover != null) {			tempS += mover.getData().toString();			mover = mover.getLink();		}//while		return tempS;	}//toString	}//WCSLinkedList